import './App.css'
import { BrowseRouter as Router, Routes, Route, Link } from 'react-rourter-dom';

const Home = () => (
  <div>
    <h2>HOME</h2>
    <p>여기는 HOME 페이지</p>    
  </div>
);

const About = () => (
  <div>
    <h2>About</h2>
    <p>여기는 About 페이지</p>
  </div>
);

const Contact = () => (
  <div>
    <h2>Contact</h2>
    <p>여기는 Contact 페이지</p>
  </div>
);

function App() {
  return (
    <Router>
    <div>
      <nav>
        <li Link to = "/">Home</li>
        <li Link to = "/about">About</li>
        <li Link to = "/contact">Contact</li>        
      </nav>
    </div>
    <hr />
    <Routes>
        <Route path="/" exact element={<Home/>}></Route>
        <Route path="/about" exact element={<About/>}></Route>
        <Route path="/contact" exact element={<Contact/>}></Route>
    </Routes>
    </Router>
  );
}

export default App;
